import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Service.css';
import Title from './../Title/Title';
import ApplyBtn from './../Apply_Btn/Apply_Btn';
import axios from 'axios';

function Service_Post(){
//   const navigate = useNavigate();
  const ButtonOnOff = (e) => {
    if(e.target.getAttribute('id') == 'off'){
        e.target.setAttribute('id', 'on');
    } else{
        e.target.setAttribute('id', 'off');
    }
  }

  return (
    <div className="Service_Top_Wrap">
        <div className="ServiceWrap">
            <Title title="서비스 신청" />
            <h3 id="categoryTitle">카테고리</h3>
            <div className="selectServiceType">
                <button type="button" id="off" onClick={ButtonOnOff}>교통</button>
                <button type="button" id="off" onClick={ButtonOnOff}>통신</button>
                <button type="button" id="off" onClick={ButtonOnOff}>주거</button>
                <button type="button" id="off" onClick={ButtonOnOff}>교육</button>
            </div>
            <h3 id="dateTitle">날짜 선택</h3>
            <input type="date" className="dateTitle"></input>
            <h3 id="applyContentTitle">신청 내용</h3>
            <textarea className="applyContent_textarea"></textarea>
        </div>
        <ApplyBtn/>
    </div>
  );
}

export default Service_Post;
